package tonutil

import (
	"encoding/hex"

	"github.com/xssnick/tonutils-go/tvm/cell"
)

func GetNftCollectionContractCode() (*cell.Cell, error) {
	hexStr := ""
	boc, err := hex.DecodeString(hexStr)
	if err != nil {
		return &cell.Cell{}, err
	}

	code, err := cell.FromBOC(boc)
	if err != nil {
		return &cell.Cell{}, err
	}

	return code, nil
}
